      src="/img/shower.png"
      alt="dancing-avatar"
    />
    {style}
  </Layout>
);

const style = (
  <style jsx>{`
    .dancing-avatar {
      width: 10rem;
      height: auto;
    }
  `}</style>
);

export default About;
